import Nav from './Nav';
import Hero from './Hero';
import Specials from './Specials';
import Footer from './Footer';
import Testimonials from './Testimonials';
import Chicago from './Chicago';

const Home = () => {
    return (
    <>
        <Nav/>
        <Hero/>
        <Specials/>
        <Testimonials/>
        <Chicago/>
        <Footer/>
    </>)
}

export default Home;
